import Cors from "cors";
import axios from "axios";
import initMiddleware from "../../lib/init-middleware";

// Initialize the cors middleware
const cors = initMiddleware(
  Cors({
    // Only allow requests with GET, POST and PUT
    methods: ["GET", "POST", "PUT"],
  })
);

export default async (req, res) => {
  // Run cors
  await cors(req, res);

  const signedUrl =
    "https://wellick-lease-image-s3-stage.s3.amazonaws.com/lease-image-1-1600825908270?AWSAccessKeyId=AKIAWQRXSB72EUDRGGZB&Expires=1600828908&Signature=zli4po3GhzvQ0ka%2BCv6yvnb%2Bjks%3D";
  let file = req.body;

  const options = {
    headers: {
      "Content-Type": file.type,
    },
  };

  console.log({ file });

  let res2;
  if (file) {
    res2 = await axios.put(signedUrl, file, options);
  }

  res.json(res2);
};
